export const PUBLIC_IMAGE_FOLDER = '/images/';
export const DEFAULT_BANNER_IMAGE = 'banner/default.png';
export const banners = ['cloud.jpg', 'dns-server.png', 'full-stack-web-development.jpg', 'js.jpg', 'load-balancer.png'];

export const selectOptions = [
    {
      label: 'Cricket',
      value: 'cricket',
    },
    {
      label: 'Football',
      value: 'football',
    },
  ];

  export const radioOptionsCricket = [
    {
      label: 'Bowler',
      value: 'bowler',
    },
    {
      label: 'Batsman',
      value: 'batsman',
    },
    {
      label: 'Wicket Keeper',
      value: 'wicket Keeper',
    },
    {
      label: 'All rounder',
      value: 'all rounder',
    },
  ];

  export const radioOptionsFootball = [
    {
      label: 'Defender',
      value: 'defender',
    },
    {
      label: 'Striker',
      value: 'striker',
    },
  ];
